@studioonfire is thrilled to have partnered with @interactcenterarts, a progressive visual arts studio, to produce this 2 color limited edition letterpress print for Michael Engebretson’s upcoming exhibition: “Transdimensional Multiversal Nonlinear Cosmic Traveler” at Interact Gallery.

