@vicky_barone, an accomplished Illustrator and Designer, is dedicated to infusing her work with positivity and joy. This summer, we happily produced an art print she designed and illustrated, bringing depth and texture to the digital creation.
In Vicky’s own words, the saying on the print serves as “a gesture of good luck to those we will miss and sailors who have served with honor and courage,” a touching homage to her late father. This meaningful expression extends further with 50% of the proceeds will be directed towards the Vietnam Veterans Memorial Fund.

We’re honored to have been a part of the process and contribute to a cause that resonates with purpose.

Read more about the narrative behind this print on Vicky’s page, where she shares the inspiration and significance behind the piece.

